pragma solidity >=0.4.0 <0.7.0;

contract OrganizationList {
    struct DocumentList {
        uint256 userid;
        Document[] signedDocs;
    }
    struct Document {
        string url;
        string oid;
        string userId;
        string hasha;
    }
    struct Organization {
        string id;
        string name;
        string secret;
    }
    struct User {
        string id;
        string name;
        string secret;
    }

    //containers
    Document[] public issuedDocuments;
    Organization[] public organizations;
    User[] public users;

    //Other useful maps
    // to return corresponding index of a unique string in the array of organizations
    mapping(string => uint256) corresOrg;
    mapping(string => uint256) corresUser;
    mapping(string => uint256) corresDocument;

    //class methods

    function createOrganization(
        string memory name,
        string memory id,
        string memory secret
    ) public {
        Organization memory newOrg = Organization(name, id, secret);
        organizations.push(newOrg);
    }

    //Organization related functions
    function issueDocument(
        string memory url,
        string memory hasha,
        string memory oid,
        string memory userId,
        string memory orgsecret
    ) public returns (uint256) {
        if (keccak256(bytes(orgsecret)) != keccak256(bytes(orgsecret))) {
            return 0;
        }

        Document memory newDoc = Document(url, oid, userId, hasha);
        uint256 l = issuedDocuments.length;
        issuedDocuments.push(newDoc);
        return l;
    }

    function deleteDocument(uint256 index) public {
        issuedDocuments[index] = Document("null", "null", "null", "null");
    }

    //User related functions
    // uint is the user id, DocumentList is the list of documents he has signed
    mapping(uint256 => DocumentList) signedAgreement;

    function createUser(
        string memory name,
        string memory id,
        string memory secret
    ) public {
        User memory newUser = User(name, id, secret);
        users.push(newUser);
    }

    function signDocument(string memory userId, uint256 docIndex) public {
        // uint256 userIndex = corresUser[userId];
        // signedAgreement[userIndex] = DocumentList(userIndex,issuedDocuments[docIndex]);
    }

    //General functions

    function verifyDocument(
        string memory url,
        string memory oid,
        string memory userId,
        uint256 docIndex,
        string memory _hash
    ) public returns (bool) {
        if (
            keccak256(bytes(issuedDocuments[docIndex].hasha)) !=
            keccak256(bytes(_hash)) ||
            keccak256(bytes(issuedDocuments[docIndex].url)) !=
            keccak256(bytes(url)) ||
            keccak256(bytes(issuedDocuments[docIndex].userId)) !=
            keccak256(bytes(userId)) ||
            keccak256(bytes(issuedDocuments[docIndex].oid)) !=
            keccak256(bytes(oid))
        ) {
            return false;
        }
        return true;
    }
}
